import React from "react";
import { useSelector } from "react-redux";

function Dashboard() {
  let storeObj = useSelector((store) => {
    return store;
  });

  return (
    <div>
      <h1>Dashboard</h1>
      <p>
        <strong>
          <code>'express.static' </code>
        </strong>
        is a built-in middleware function in <strong></strong><code>Express.js</code> that serves
        static files such as images, CSS, JavaScript, and other assets. It
        allows you to expose a directory to the web so that users can access the
        files directly via a URL. It is typically used to serve files from a
        specified directory on the server.
      </p>
      <h2>First Name: {storeObj.loginDetails.firstName}</h2>
      <h2>Last Name: {storeObj.loginDetails.lastName}</h2>
      <img
        src={`http://localhost:4567/${storeObj.loginDetails.profilePic}`}
      ></img>
    </div>
  );
}

export default Dashboard;
